function Navbar() {
    return (

        <nav>
            <ul class="flex">
                <li class="mr-6">
                    <a class="text-blue-500 hover:text-blue-800" href="#">Active</a>
                </li>
                
                <li class="mr-6">
                    <a class="text-teal-300" href="#">HOME</a>
                </li>
            </ul>
        </nav>




    );
}

export default Navbar;
